import React, { Component } from 'react'
import arrows from '../constellationArrow.png';
export default class DOB extends Component {

    constructor(props){
        super(props);

        this.state = {starSign:''};

        this.handleContinue = this.handleContinue.bind(this);


    }


    handleContinue()
    {

    }



    render() {
        return (
            <div className="dob">
    <div className="form">
            <label>My date of birth is the</label>
<label>of</label>
<select className="DOBMonth">
    <option value="January">January</option>
    <option value="Febuary">Febuary</option>
    <option value="March">March</option>
    <option value="April">April</option>
    <option value="May">May</option>
    <option value="June">June</option>
    <option value="July">July</option>
    <option value="August">August</option>
    <option value="September">September</option>
    <option value="October">October</option>
    <option value="November">November</option>
    <option value="December">December</option>
</select>


<br></br>

<img className="arrow" src={arrows} alt="Continue.." onClick={this.handleContinue}></img>
</div>

</div>
)}
}
